import React from 'react';
import './PersonalDetails.css';  

export default function PersonalDetails() {
    // Sample data - in a real app, you might fetch this data from an API or state management store
    const userDetails = {
        fullName: 'Garrett Audet',
        email: 'josephine.meyers@mail.co.uk',
        phoneNumber: '+44 3245 5521 5521',
        address: 'London, UK'
    };

    return (
        <div className="personalDetails">
            <h2>Personal Details</h2>
            <div className="detailItem">
                <strong>Full name:</strong> <span>{userDetails.fullName}</span>
            </div>
            <div className="detailItem">
                <strong>Email:</strong> <span>{userDetails.email}</span>
            </div>
            <div className="detailItem">
                <strong>Phone number:</strong> <span>{userDetails.phoneNumber}</span>
            </div>
            <div className="detailItem">
                <strong>Address:</strong> <span>{userDetails.address}</span>
            </div>
        </div>
    );
}
